// CardView.js
import React, { useState } from "react";
import Card from "./Card";
import "./CardView.css";

const extractData = (data) => {
  let count = data.count;
  let extractedData = [];
  for (let i = 0; i < count; i++) {
    extractedData.push({
      id: i + 1,
      volume: data.volume[i],
      Rupee: data.Rupee[i],
    });
  }
  return extractedData;
};

function CardView(props) {
  const card = props.cards.filter((item) => item.id === 2);
  console.log(card);

  const [data, setData] = useState(extractData(card));

  return (
    <div className="card-view">
      {data.map((item, index) => (
        <li key={index}>
          {(Card) => (
            <Card key={item.id} volume={item.volume[1]} Rupee={item.Rupee} />
          )}
        </li>
      ))}
    </div>
  );
}

export default CardView;
